import React, { Component } from 'react';
import {Link} from 'react-router-dom';


class Admin extends Component {
	
	render() {
		return( 
		<div>
			<h1>This is admin page</h1>
			<Link to="/">Logout</Link>
		</div>

		);
	}
}

export default Admin;
